// src/index.js
import React from "react";
import ReactDOM from "react-dom";
import App from "./App.js";
import './App.scss';
import './index.css';
import Header from "./components/Header.js";
import Footer from "./components/Footer.js";

ReactDOM.render(
  <div>
    <Header />
    <App />
    <Footer />
  </div>,
  document.getElementById("root")
);
